var dataText = `[{"section":"header","element":"lang-select","ok":"","pl":"pl","en":"en"},{"section":"about","element":"heading","ok":"1","pl":"FHU ROLEWICZ","en":"FHU ROLEWICZ"},{"section":"about","element":"p1","ok":"1","pl":"Rodzinna firma dynamicznie rozwijająca się w branży TSL. Świadczymy kompleksowe usługi transportowe oraz spedycyjne. Realizujemy zarówno przewozy krajowe, jak i międzynarodowe. Cechuje nas zaangażowanie w każdy powierzony nam transport oraz terminowość dostaw. Dzięki wysokiej dyspozycyjności naszych pracowników gwarantujemy profesjonalne doradztwo oraz doskonały przepływ informacji. Naszym głównym atutem są dostawy w systemie „just in time” – dokładnie na czas. ","en":"A family company dynamically developing in the TSL trade. We provide comprehensive transport and freight forwarding services, offering both domestic and international transport. We are characterized by commitment to each service entrusted to us and timeliness of performed commissions."},{"section":"about","element":"p2","ok":"1","pl":"Realizujemy zarówno przewozy w ramach długookresowych kontraktów, jak i jednorazowe zlecenia","en":"We guarantee professional advice and excellent information flow due to the high availability of our employees. Our main advantage is a delivery just in time. We cooperate with both long-term contracts and one off orders."},{"section":"advantages","element":"heading","ok":"1","pl":"ZALETY","en":"ADVANTAGES"},{"section":"advantages","element":"1-h","ok":"1","pl":"Indywidualne podejście","en":"Individual approach"},{"section":"advantages","element":"1-p","ok":"1","pl":"Dzięki szerokiej gamie świadczonych usług dopasujemy ofertę oraz tabor do potrzeb i wymagań klienta z każdego sektora gospodarki oraz klienta indywidualnego przy zachowaniu konkurencyjności cen.","en":"Having a wide range of services provided, we're able to adapt the offer and fleet of vehicles to the customer’s requirements from each economic sector as well as private customers, while maintaining price competitiveness."},{"section":"advantages","element":"2-h","ok":"1","pl":"Bezpieczeństwo","en":"Security"},{"section":"advantages","element":"2-p","ok":"1","pl":"Tabor wyposażony w system GPS, dzięki czemu zapewniamy bieżącą lokalizację ładunku 24/7. Posiadamy wszelkie ubezpieczenia na transport i spedycję ładunków. Gwarantujemy zachowanie poufności informacji.","en":"The fleet is equipped with a GPS system which traces the location of the load at all time. We are a fully licenced transport and spedition company, thus all activities are covered by CMR, Cabotage, and Spedition Insurace. We guarantee confidentiality."},{"section":"advantages","element":"3-h","ok":"1","pl":"Punktualność dostaw","en":"Timeliness of deliveries"},{"section":"advantages","element":"3-p","ok":"1","pl":"Specjalizujemy się w dostawach terminowych oraz ekspresowych. Dostarczymy powierzony nam towar w ciągu 24h od załadunku do większości krajów Unii Europejskiej oraz pomiędzy nimi.","en":"We specialize in timely and express deliveries. We deliver the goods entrusted to us within 24 hours between any two EU countries."},{"section":"advantages","element":"4-h","ok":"1","pl":"Doświadczenie","en":"Experience"},{"section":"advantages","element":"4-p","ok":"1","pl":"Posiadamy wykwalifikowaną kadrę z wieloletnim doświadczeniem w transporcie i spedycji na arenie krajowej oraz międzynarodowej. Nasz dynamicznie rozwijający się zespół stawia na podnoszenie swoich kompetencji zawodowych oraz powiększanie floty. Dzięki naszemu doświadczeniu dopasujemy najlepsze rozwiązanie dla naszych klientów.","en":"Our qualified staff has many years of experience in the national and international transport and forwarding trade. Our dynamically developing team focuses on raising their professional competences and expanding the fleet. Thanks to our experience we find the best solution for our customers."},{"section":"advantages","element":"5-h","ok":"1","pl":"Dyspozycyjność","en":"Availability"},{"section":"advantages","element":"5-p","ok":"1","pl":"Ze względu na rodzinny charakter firmy pozostajemy do Państwa dyspozycji 24h na dobę przez 7 dni w tygodniu.","en":"Owing to the fact that we're a family business, we are available for our clients 24 hours a day, 7 days a week."},{"section":"advantages","element":"6-h","ok":"1","pl":"Flota pojazdów","en":"Fleet of vehicles"},{"section":"advantages","element":"6-p","ok":"1","pl":"Zapewniamy tabor wysokiej jakości oraz wykwalifikowanych kierowców, co umożliwia odpowiednie zabezpieczenie.","en":"We provide a high quality of fleet and qualified drivers, which assures proper security."},{"section":"advantages","element":"7-h","ok":"","pl":"Kontrola i nadzór","en":"Control and supervision"},{"section":"advantages","element":"7-p","ok":"","pl":"Gwarantujemy całodobowy monitoring przewożonego towaru przez GPS i kontakt klient – spedytor – kierowca.","en":"We guarantee 24-hour tracking and tracing of transported goods by GPS and express information flow between the customer and the driver."},{"section":"offer","element":"heading","ok":"1","pl":"OFERTA TRANSPORTOWO - SPEDYCYJNA","en":"OUR OFFER"},{"section":"offer","element":"subheading","ok":"1","pl":"Oferujemy szeroki wachlarz usług w zakresie transportu i spedycji towarów:","en":"We offer a wide range of road transport and spedition services:"},{"section":"offer","element":"1-h","ok":"1","pl":"Transport całopojazdowy","en":"Transport FTL"},{"section":"offer","element":"1-s","ok":"1","pl":"Krajowy i międzynarodowy","en":"Full Truck Loaded"},{"section":"offer","element":"1-p","ok":"1","pl":"Są to usługi wykonywane dedykowanym środkiem transportu, indywidualnie dopasowanym do rodzaju przewożonego ładunku.","en":"Services using a dedicated truck, individually matched to the type of cargo. It's the safest and most efficient tranport arrangment."},{"section":"offer","element":"2-h","ok":"1","pl":"Transport drobnicowy","en":"Transport LTL"},{"section":"offer","element":"2-s","ok":"1","pl":"Krajowy i międzynarodowy","en":"Less Than Full Truck Loaded"},{"section":"offer","element":"2-p","ok":"1","pl":"Mając na celu obniżenie kosztów przewozu proponujemy naszym klientom konsolidację czyli transport kilku pojedynczych ładunków jednym środkiem transportu.","en":"In order to minimize the costs of transport we suggest sharing a single mode of transport among multiple individual pieces of cargo."},{"section":"offer","element":"3-h","ok":"1","pl":"Transport ekspresowy","en":"Express transport"},{"section":"offer","element":"3-s","ok":"1","pl":"Krajowy i międzynarodowy","en":"Domestic and International"},{"section":"offer","element":"3-p","ok":"1","pl":"Pozwala na szybkie reagowanie na potrzeby klienta. Docieramy do każdego zakątka Europy w jak najkrótszym czasie – stały monitoring GPS i kontakt telefoniczny.","en":"We are experts at express transport. if you need to make delivery as soon as possible, or just in time, we will be there. Loading and delivery in the same day? - No problem. Delivery next day first opening hour - we love to do that."},{"section":"offer","element":"4-h","ok":"1","pl":"Transport kabotażowy","en":"Cabotage transport"},{"section":"offer","element":"4-s","ok":"1","pl":"Krajowy i międzynarodowy","en":"Domestic and International"},{"section":"offer","element":"4-p","ok":"1","pl":"Przewóz towarów na terytorium krajów Unii Europejskiej. Nasza firma specjalizuje się głównie w przewozach na terenie Francji, Niemczech, Hiszpanii i krajów Beneluksu.","en":"We specialize in cabotage transport in the area of Europe Union, mainly in France, Germany, Spain, Portugal, UK, Italy and Benelux (Holland, Belgium, Luxemburg)."},{"section":"offer","element":"cta","ok":"","pl":"Zapraszamy do współpracy","en":"Do not hesitate to contact us!"},{"section":"inquiry","element":"heading","ok":"1","pl":"WYCENA USŁUGI TRANSPORTOWO – SPEDYCYJNEJ","en":"INQUIRY"},{"section":"inquiry","element":"subheading","ok":"1","pl":"Aby otrzymać darmową wycenę usługi zachęcamy do wypełnienia poniższego formularza<br>lub kontaktu telefonicznego.","en":"In order to get a free quote, please fill in the form below or give us a call."},{"section":"inquiry","element":"name","ok":"1","pl":"Firma / osoba kontaktowa *","en":"Company / contact name *"},{"section":"inquiry","element":"tel","ok":"1","pl":"Telefon","en":"Phone number"},{"section":"inquiry","element":"email","ok":"1","pl":"E-mail *","en":"E-mail *"},{"section":"inquiry","element":"pickup","ok":"1","pl":"Miejsce załadunku *","en":"Pickup location *"},{"section":"inquiry","element":"dropoff","ok":"1","pl":"Miejsce rozładunku *","en":"Drop-off location *"},{"section":"inquiry","element":"pickup-date","ok":"1","pl":"Data załadunku","en":"Pickup date"},{"section":"inquiry","element":"dropoff-date","ok":"1","pl":"Data rozładunku","en":"Drop-off date"},{"section":"inquiry","element":"type","ok":"1","pl":"Rodzaj ładunku *","en":"Cargo type *"},{"section":"inquiry","element":"weight","ok":"1","pl":"Waga *","en":"Weight *"},{"section":"inquiry","element":"description","ok":"1","pl":"Dodatkowy opis","en":"Additional description"},{"section":"contact","element":"heading","ok":"1","pl":"KONTAKT","en":"CONTACT"},{"section":"contact","element":"address","ok":"1","pl":"<b> FHU Mirosława Rolewicz </b><br>ul. Śniadeckich 36/56<br>86-300 Grudziądz<br>NIP/VAT nr: 8761092698<br>Regon: 870332530","en":"<b> FHU Mirosława Rolewicz </b><br>ul. Śniadeckich 36/56<br>86-300 Grudziądz<br>NIP/VAT nr: 8761092698<br>Regon: 870332530"},{"section":"contact","element":"tel","ok":"1","pl":"Telefon:<br>","en":"Telephone:<br>"},{"section":"contact","element":"email","ok":"1","pl":"Email:","en":"Email:"},{"section":"component","element":"inquire","ok":"1","pl":"Dowiedz się więcej","en":"Inquire Now"}]`;
